let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = match x with 
      |(i, j) -> match a with
        |(m, n) -> match n with 
          |[] -> (0, [])
          |h::t -> if i + j + m >= 10 
              then (1, (1::((i+j+m-10)::t)))
              else (0, (0::((i+j+m)::t)))
    in
    let base = (0, [0]) in
    let args = List.combine (List.rev l1) (List.rev l2) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))


