let bigMul l1 l2 = 
  let f a x = match x with
    |(m, n) -> match a with 
      |(i, j) -> (0::i, bigAdd ((mulByDigit m n)@i) (j))
  in
  let base = ([], [0]) in
  let args = pairHelper (List.rev l1) l2 in
  let (_, res) = List.fold_left f base args in
    res


